configure:
  commands:
    20.20.20.1 255.255.255.0: "20.20.20.1 255.255.255.0\r\n"
    description IXIA_P1: "description IXIA_P1\r\n"
    end:
      new_state: execute
    line console 0:
      new_state: configure_line
    no logging console: ''
    object-group network ogacl_network_P1: "object-group network ogacl_network_P1\r\
      \n"
  prompt: P-R1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: P-R1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: P-R1#
